import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import ProjectList from './components/ProjectList';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <ProjectList />
      </main>
      <Footer />
    </div>
  );
}

export default App;
